<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <title>Title</title>
</head>
<body>
<script>
    var ary = [3,5,9,5,9,9,6,3];
    for (var i = 0; i < ary.length-1; i++) {
        var cur = ary[i];
        for (var j = i+1; j < ary.length; j++) {
            if(cur == ary[j]){
                ary.splice(j,1);
                j--;
            }
        }
    }
    console.log(ary);
</script>
</body>
</html>
